import React from "react";
// import {Navbar,Form,FormControl ,Nav} from "react-bootstrap";
import {Navbar,Nav,Form} from "react-bootstrap";
import './SNavbar.css';
function SNavbar() {
    return (

      <div className="FNavbar">

    <Navbar variant="light" style={{backgroundColor:"#white"}}>
    <Navbar.Brand href="#home"></Navbar.Brand>
    <Nav className="mr-auto">
      <Nav.Link href="#Call Now">Call Now</Nav.Link>
      <Nav.Link href="https://www.google.com/maps/@32.0951607,20.0979697,14z">Get Direction</Nav.Link>
     </Nav>
     <Form inline>
     <Nav className="mr-auto">
      <Nav.Link href="https://www.facebook.com/sugarcoffeemakecheesecak/"><img src="Facebook.png" alt="Facebooklogo"/></Nav.Link>
      <Nav.Link href="https://www.instagram.com/sugarcoff14/"><img src="instegram.png" alt="instegramlogo"/></Nav.Link>
      <Nav.Link href="#Get Direction"><img src="snapchat.png" alt="snapchatlogo"/></Nav.Link>
      <Nav.Link href="#Get Direction"><img src="twitter.png" alt="twitterlogo"/></Nav.Link>
     </Nav>
    </Form>
   </Navbar>
   
   <span> <i className="fab fa-facebook" /></span>

</div>
  );
}

export default SNavbar;
